import React from "react"


function Projects(){

    var[effect,setEffect] = false;

    function onClicked(){
        setEffect((prev)=>{
            return !prev;
        })
    }


    return(
        <section id="projects" className="colored-section">
            <div className="container-fluid">

            <h2 className="sub-title">Projects</h2>

                <div className="mobile">
                            <img src="images/clima.png" alt="flowers" className="prjImg1" onClick={onClicked}/>
                            <img src="images/chit-chat.png" alt="flows" className="prjImg2" onClick={onClicked}/>
                            <img src="images/bytecoin.png" alt="flowers" className="prjImg3" onClick={onClicked}/>
                            <img src="images/bmi.png" alt="flowers" className="prjImg4" onClick={onClicked}/>
                </div>

                <div className="web">
                            <img src="images/watchflix.png" alt="flowers" className="prjImg1" onClick={onClicked}/>
                            <img src="images/blog.png" alt="flows" className="prjImg2" onClick={onClicked}/>
                            <img src="images/simon.png" alt="flowers" className="prjImg3" onClick={onClicked}/>
                </div>
            </div>
        </section>




    )
}


export default Projects;
